var YS = "<p>发布日期：2025年05月15日</p><p>更新日期：2025年05月15日</p><p>生效日期：2025年05月15日</p><p>&nbsp;</p><p>温馨提示</p><p>&nbsp;</p><p>我们非常重视保护您的个人信息与隐私！依据最新的监管要求，我们特向您说明如下：</p><p>1. 为向您提供医生简历服务，我们将根据法律及《医简历隐私政策》收集、使用提供服务所必需的个人信息</p><p>2. 基于您的明示授权，我们可能会调取您的设备权限，您有权拒绝或取消授权；</p><p>3. 我们会采取严格的技术措施和管理措施以保护您的信息安全；</p><p>4. 未经您同意，我们不会向第三方共享您的个人信息。</p><p>您可以查询、更正、删除您的个人信息，我们也提供撤回同意、注销&nbsp;账号&nbsp;、投诉举报的渠道。</p><p>&nbsp;</p><p>医简历隐私政策</p><p>&nbsp;</p><p>北京昔心医伴医疗科技有限公司（注册地址：北京市大兴区黄村镇海鑫路8号院6号楼1层，以下简称“&nbsp;医简历&nbsp;”或“&nbsp;我们&nbsp;”）系医简历的运营者。我们非常重视保护用户（以下简称“您”）的个人信息和隐私。您在注册、登录和使用医简历时，我们会收集、使用、保存、共享您的相关个人信息。为呈现我们处理您个人信息的情况，我们特制定《医简历隐私政策》（以下简称“&nbsp;隐私政策&nbsp;”），我们承诺严格按照本隐私政策处理您的个人信息。</p><p>我们在此提醒您：&nbsp;</p><p>在您注册登录医简历前，请您务必认真阅读本隐私政策，充分理解各条款内容。若您为未成年人（未满18周岁），请您在您的监护人监护、指导并获得监护人同意的前提下，认真阅读本隐私政策方可使用医简历。您知晓并确认，当您勾选或点击“同意”本隐私政策，就表示您同意我们按照本隐私政策处理您的个人信息。您也可以通过&nbsp;《医简历隐私政策概要》&nbsp;快速了解前述事宜。</p><p>&nbsp;</p><p>本隐私政策适用范围是医简历小程序。其中会议通所提供服务仅面向完成企业认证的用户。</p><p>&nbsp;</p><p>本隐私政策将帮助您了解以下内容：</p><p>一、 我们如何收集和使用您的个人信息</p><p>二、 我们如何保存您的个人信息</p><p>三、 我们如何共享、转让、公开披露您的个人信息</p><p>四、 我们如何使用Cookie技术</p><p>五、 第三方产品或服务如何获得您的个人信息</p><p>六、 我们如何保护您的个人信息</p><p>七、 您如何管理您的个人信息</p><p>八、 我们如何处理未成年人的个人信息</p><p>九、本隐私政策如何更新</p><p>十、 如何联系我们</p><p>&nbsp;</p><p>一、 我们如何收集和使用您的个人信息</p><p>&nbsp;</p><p>我们将医简历的业务功能分为基本业务功能、扩展业务功能两类：</p><p>（1） 基本业务功能是实现简历扫描、管理必备的功能。</p><p>（2） 扩展业务功能是基于简历扫描功能的扩展功能及其他第三方服务。</p><p>请您理解，医简历可能需要开启部分权限并收集必要的个人信息才能得以实现部分服务。您可以通过查询&nbsp;《个人信息收集清单》&nbsp;及&nbsp;《应用权限说明》&nbsp;快速了解我们在特定业务功能/场景下为实现相应目的而收集的个人信息及调用的权限。</p><p>&nbsp;</p><p>（一） 基本业务功能中我们收集和使用您个人信息的情形</p><p>&nbsp;</p><p>1. 完成注册&nbsp;</p><p>当您注册医简历时，我们将会收集您所需要填写的&nbsp;手机号码&nbsp;&nbsp;。我们收集您的上述信息是为了帮助您完成医简历账号的注册，保护您的账号安全，如您不提供这类信息，我们将无法为您创建账号并正常向您提供服务。&nbsp;</p><p>注册医简历账号后，如您选择绑定邮箱，我们将会收集您所绑定的&nbsp;电子邮箱&nbsp;&nbsp;。我们收集您的上述信息是为了帮助您使用邮箱进行账号登录。如果您不同意我们收集前述信息，您可能无法成功绑定邮箱，但不影响您正常使用我们的其他功能。&nbsp;</p><p>2. 简历扫描&nbsp;</p><p>当您进行简历拍摄和添加简历至相册的操作时，我们需要调用您设备的&nbsp;相机&nbsp;、&nbsp;存储&nbsp;权限。我们调用上述权限是为了帮助您完成简历扫描和简历编辑，该处理在本地完成，我们不会收集、使用您的个人信息，如您不同意我们调用上述权限，您可能因无法完成简历添加而不能正常使用我们的服务。&nbsp;请您知晓，即使您已同意开启相机和存储权限，也仅会在您主动拍摄或选择的照片范围内进行相关处理&nbsp;。&nbsp;</p><p>3. 简历的分发、存储、读取和管理&nbsp;</p><p>当您进行简历分发时，我们会将您选定的简历发送至您选定的第三方，第三方可访问、查看您分发的简历信息。当您向使用企业数字简历的用户发送简历，该用户可通过企业简历夹授权其所在企业访问您的简历信息。当您进行简历扫描、存储、读取和删除的操作时，我们需要调用您的&nbsp;设备存储&nbsp;权限。我们调用上述权限是为了帮助您完成简历的读取、内容编辑和管理。&nbsp;除您拍摄及自行选定的简历资料外，我们不会处理您在存储空间内的其他资料&nbsp;。如您不同意我们调用上述权限，您可能因无法完成简历读取、内容编辑和管理而不能正常使用我们的服务。&nbsp;</p><p>您在使用我们的产品和服务时上传的信息可能属于您或者他人受法律保护之个人信息，&nbsp;可能涉及您本人或者他人隐私&nbsp;，或者可能受著作权法等法律保护，您应当确保已获得许可拥有必要权利以复制、上传这些数据信息，并请您进行适当的设置和采取适当的安全防护措施，以防止该信息泄漏损害权利人的利益。请高度注意保护您自己或者他人的数据信息，未经授权不得擅自披露或公开。&nbsp;</p><p>4. 保障账号、网络访问和服务的基本安全&nbsp;</p><p>为了保障您账号、网络访问和服务的基本安全，我们需要调用您设备的&nbsp;手机状态&nbsp;权限，我们需要收集您的&nbsp;唯一识别符（OpenID、unionid）&nbsp;、手机系统的语言、国家、城市、&nbsp;IP地址&nbsp;，设备信息（浏览器类型，设备类型和型号，系统语言，操作系统版本，时间戳和区域）、医简历注册账户ID、软件安装列表、&nbsp;您的网络行为轨迹（包括点击次数、参与时间）&nbsp;、访问日期和时间、服务日志信息。我们会将上述信息结合，进行处理与数据分析，针对账号形成用户画像和相关风控记录，我们收集您的上述信息是为了保障您的账号、网络访问和应用运行的安全，如您不同意我们收集前述信息，可能因无法完成安全风控验证而不能正常使用我们的服务。&nbsp;</p><p>&nbsp;</p><p>（二） 扩展业务功能中我们收集和使用您个人信息的情形</p><p>&nbsp;</p><p>1. OCR识别功能&nbsp;</p><p>当您使用OCR识别功能时，无论是在本地处理还是在云端处理，我们都需要调用您设备的&nbsp;&nbsp;相机&nbsp;权限或&nbsp;存储&nbsp;权限，以获取您预备进行处理的简历；&nbsp;我们获取您的上述信息是为了协助您实现OCR识别功能，提高您的办公效率，如您拒绝开启相应权限，我们将无法为您提供OCR识别功能，但不影响您正常使用我们的其他功能。&nbsp;即使您已同意开启相机、设备存储权限，也仅会在您主动拍摄的照片或选择的简历范围内处理相关信息&nbsp;&nbsp;。&nbsp;</p><p>2. 电子简历功能&nbsp;</p><p>当您补充自己的电子简历信息时，我们将会收集您所需要填写的&nbsp;真实姓名、公司、职位&nbsp;，如您不提供这些信息，我们将无法补充您的电子简历信息，进而无法为您提供对外发送简历操作的功能，但不影响您正常使用我们的其他服务。如果您希望进一步完善自己的电子简历信息，我们还将会收集您主动选择填写的&nbsp;行业、所在城市、联系信息（手机、邮箱、地址）、工作经历、教育经历&nbsp;，如您不提供这些信息，不影响您正常使用电子简历功能，对外发生简历的操作。&nbsp;</p><p>3. 企业认证&nbsp;</p><p>如果您需要使用企业认证服务，为了确保企业认证的真实有效性，需要您提交相关企业全称，如您认证的企业为大陆企业，还需要您提交&nbsp;营业执照&nbsp;及&nbsp;企业认证公函&nbsp;进行认证；如您认证的企业为事业单位/社会组织，还需要您提交&nbsp;事业单位/社会组织法人证书&nbsp;及&nbsp;企业认证公函&nbsp;进行认证；如您认证的企业为律师事务所，还需要您提交&nbsp;律师事务所执业许可证&nbsp;及&nbsp;企业认证公函&nbsp;进行认证。如您不提供这些信息，我们无法为您提供企业认证服务，但不影响您正常使用我们的其他服务。&nbsp;</p><p>4.认证加V</p><p>实名认证：当您申请实名认证时，我们将会收集您的&nbsp;真实姓名、手机号码&nbsp;，我们收集您的上述信息是为了帮助您完成实名认证，如您不提供这些信息，我们将无法为您提供实名认证服务，但不影响您正常使用我们的其他服务。</p><p>5.企业查询报告</p><p>当您进行企业信息查询并想要获取查询报告时，我们将会收集您所需要填写的&nbsp;&nbsp;邮箱地址或联系电话&nbsp;。该服务由我们的关联公司上海生腾数据科技有限公司提供，如您不提供这些信息，我们将无法为您提供企业信息查询报告服务，但不影响您正常使用我们的其他服务。</p><p>6. 企业录入&nbsp;</p><p>当您进行企业在线录入时，我们会收集您填写录入的企业成员简历信息（&nbsp;姓名&nbsp;、公司、职位、&nbsp;手机号&nbsp;、邮箱（选填）)。我们收集您的上述信息是为了录入您的企业成员简历信息，如您不提供这类信息，相应成员简历信息将无法录入，但不影响您正常使用我们的其他服务。</p><p>7. 支付结算&nbsp;</p><p>当您在医简历进行支付结算时，&nbsp;我们会收集您的&nbsp;订单信息&nbsp;、&nbsp;交易状态&nbsp;，我们会从微信获取您的付款是否成功的信息，我们收集上述信息是为了确认您的订单状态以向您提供服务，保护您的财产安全以及处理用户纠纷，如您不同意我们收集上述信息，您可能因无法完成支付结算而无法购买增值服务（如精准识别服务、企业数据导出服务、搜索支持高级筛选服务）。&nbsp;</p><p>如您申请开具电子发票，请联系我们客服</p><p>客服电话：18612571695</p><p>客服邮箱：691932539@qq.com</p><p>8. 账号设置&nbsp;</p><p>当您对账户内容进行设置时，我们需要收集您的功能设置选项。我们收集您的上述信息是为了保护您的隐私，或保证生成的简历符合或接近您的预期，如您不提供这类信息，则我们将无法为您提供账户内容设置服务，但不影响您正常使用我们的其他服务。&nbsp;</p><p>9.&nbsp;客户服务&nbsp;</p><p>在您通过向我们提出投诉、建议或进行反馈时，为便于与您联系、尽快帮助您解决问题或记录相关问题的处理方案及结果，我们可能会收集您与我们的&nbsp;通信或通话记录&nbsp;、您提供的账号信息、您提供的联系方式信息（邮箱地址或联系电话）、您为了证明相关事实提供的信息。我们收集上述信息是为了完成客户服务，如您不提供这类信息，您的投诉、建议和反馈可能无法得到及时、有效处理，但不影响您正常使用我们的其他服务。</p><p>&nbsp;</p><p>&nbsp;（三）征得同意的例外</p><p>&nbsp;</p><p>请您理解，在下列情形中，根据法律法规，我们处理您的个人信息无需征得您的授权同意。</p><p>1. 根据您的要求订立或履行合同所必需；&nbsp;</p><p>2. 为履行法定职责或者法定义务所必需，例如与国家安全、国防安全、与刑事侦查、起诉、审判和判决执行等直接相关的法定职责或者法定义务；&nbsp;</p><p>3. 为应对突发公共卫生事件，或者紧急情况下为保护自然人的生命健康和财产安全所必需；&nbsp;</p><p>4. 为公共利益实施新闻报道、舆论监督等行为，在合理的范围内处理个人信息；</p><p>5. 在合理的范围内处理你自行公开的个人信息，或者其他已经合法公开的个人信息（如合法的新闻报道、政府信息公开等渠道合法公开的个人信息）；</p><p>6. 法律法规规定的其他情形。</p><p>特别说明：根据法律规定，如信息无法单独或结合其他信息识别到特定个人的，其不属于个人信息。当您的信息可以单独或结合其他信息识别到您时，或我们把没有与任何特定个人建立联系的数据与您的个人信息结合使用时，我们会将其作为您的个人信息，按照本隐私政策进行处理与保护。</p><p>&nbsp;</p><p>&nbsp;二、 我们如何保存您的个人信息</p><p>&nbsp;</p><p>我们将在本隐私政策载明的目的所需的最短保存期限之内，保存您的个人信息，除非法律法规另有规定，或您向我们另行授权延长保存期限。前述期限届满后，我们将对您的个人信息做删除或匿名化处理。</p><p>我们将您的个人信息保存在中国境内。如您要求将您的个人信息传输到境外，请您通过&nbsp;691932539@qq.com联系我们，我们会遵守相关法律规定进行处理。</p><p>&nbsp;</p><p>三、 我们如何共享、转让、公开披露您的个人信息</p><p>&nbsp;</p><p>1. 共享</p><p>您同意我们为向您提供服务而向支持我们功能的关联方共享您的个人信息。这些支持包括为我们提供基础设施技术服务、支付服务、数据处理，支持我们功能的关联方无权将您的个人信息用于与本隐私政策所载明的目的无关的其他用途；如要改变个人信息的处理目的，他们将另行征得您的授权同意&nbsp;。&nbsp;我们目前不会将您的个人信息共享给除关联方以外的第三方&nbsp;，如需将您的个人信息共享给&nbsp;除关联方以外的第三方&nbsp;，我们会另行征求您的同意。&nbsp;</p><p>2. 转让&nbsp;</p><p>我们不会将您的个人信息转让给任何公司、组织和个人，但在涉及合并、收购或破产清算时，如涉及到个人信息转让，我们会向您告知，并要求新的持有您个人信息的公司、组织继续受此个人信息保护政策的约束，否则我们将要求该公司、组织重新向您征求授权同意。&nbsp;</p><p>3. 公开披露&nbsp;</p><p>我们仅会在另行获得您明确同意，或基于法律规定，或行政机关或司法机关的合法要求时，公开披露您的个人信息。&nbsp;</p><p>根据法律规定、行政机关或司法机关的要求所必须提供您个人信息的情况下，我们可能会依据所要求的个人信息类型和披露方式公开披露您的个人信息。在符合法律的前提下，当我们收到上述披露信息的要求时，我们会要求必须出具与之相应的法律文件，如传票或调查函。我们将对所有的要求都进行慎重的审查，以确保其具备合法依据，且仅限于执法部门因特定调查目的且有合法权力获取的数据。&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>四、 第三方产品或服务如何获得您的个人信息</p><p>&nbsp;</p><p>您同意并理解，为了更好地提供服务，我们的产品可能会集成或接入第三方服务，如SDK、API或H5。</p><p>为使您可以更好地了解第三方服务类型和接入方式，您可以查看&nbsp;《第三方信息数据共享清单》&nbsp;以进一步了解。</p><p>&nbsp;</p><p>&nbsp;五、 我们如何保护您的个人信息</p><p>&nbsp;</p><p>我们非常重视用户个人信息的安全。为此，我们采取了行业通行的数据保护技术与管理措施，例如网络隔离、数据加密、访问控制措施。</p><p>请您知悉，虽然我们依法采取了合理的措施保护您的信息，但没有任何系统或网络是绝对安全的。如果我们的物理、技术或管理防护设施遭到破坏，导致信息被非授权访问、公开披露、篡改、或毁坏，导致您的合法权益受损，我们将在法律规定的范围内承担责任，我们也将尽最大努力追究侵权人的法律责任，同时希望您尽最大努力配合我们的工作。</p><p>在不幸发生个人信息安全事件后，我们将按照法律法规的要求向您告知：安全事件的基本情况和可能的影响、我们已采取或将要采取的处置措施、您可自主防范和降低风险的建议、对您的补救措施。事件相关情况我们将以邮件、信函、电话、推送通知的方式告知您，难以逐一告知个人信息主体时，我们会采取合理、有效的方式发布公告。同时，我们还将按照监管部门要求，上报个人信息安全事件的处置情况。</p><p>我们的个人信息安全责任部门为【信息安全委员会】，联络方式及投诉渠道电话为18612571695，邮箱为&nbsp;691932539@qq.com</p><p>&nbsp;&nbsp;</p><p>六、 您如何管理您的个人信息</p><p>&nbsp;</p><p>在您使用医简历期间，您可以访问、更正、删除您的个人信息，以及行使改变授权同意的范围与注销账号的权利，您的意见会及时得到处理。&nbsp;&nbsp;</p><p>1. 访问您的个人信息&nbsp;</p><p>您有权访问您的个人信息，法律法规规定的例外情况除外。如果您想行使数据访问权，可以&nbsp;通过&nbsp;【首页】&nbsp;-&nbsp;【顶部“我的简历”】&nbsp;&nbsp;-&nbsp;【编辑&nbsp;】&nbsp;&nbsp;页面进行访问。&nbsp;如果您无法自行访问您的个人信息，请联系客服进行访问，我们将在收到请求的十五个工作日内进行处理。&nbsp;</p><p>2. 更正您的个人信息&nbsp;</p><p>当您发现我们处理的关于您的个人信息有错误时，您有权要求我们作出更正。&nbsp;请通过【首页】-【顶部“我的简历”】&nbsp;-&nbsp;【编辑&nbsp;】&nbsp;进行更正&nbsp;。如果您无法自行更正您的个人信息，请联系客服进行更正，我们将在收到请求的十五个工作日内进行处理。&nbsp;</p><p>3. 更新您的个人信息&nbsp;</p><p>您有权更新您的个人信息，请通过【首页】-【顶部“我的简历”】&nbsp;-&nbsp;【编辑&nbsp;】&nbsp;页面进行更新。如您需更换账号绑定的手机号码、微信账号、邮箱，&nbsp;请通过【首页】-【左上角“更多”】-【账号管理】-【更换绑定账号】进行更新。&nbsp;如果您无法自行更新您的个人信息，请联系客服更新，我们将在收到请求的十五个工作日内进行处理。&nbsp;</p><p>4. 删除您的个人信息&nbsp;</p><p>对于您上传的简历，您可以在“简历夹”页面自行删除。对于您设置的个人信息，您可以在&nbsp;【首页】-【顶部“我的简历”】&nbsp;-&nbsp;【编辑&nbsp;】&nbsp;页面自行删除。如果您无法自行删除您的个人信息，请联系客服进行删除，我们将在收到请求的十五个工作日内进行处理。</p><p>在以下情形中，您可以向我们提出删除个人信息的请求，但已做匿名化处理或法律法规另有规定的除外：&nbsp;</p><p>（1） 我们违反法律法规或与您的约定收集、使用个人信息；&nbsp;</p><p>（2） 我们违反法律法规或与您的约定与第三方共享或转让您的个人信息，我们将立即停止共享、转让行为，并通知第三方及时删除；&nbsp;</p><p>（3） 我们违反法律法规规定或与您的约定，公开披露您的个人信息，我们将立即停止公开披露的行为，并发布通知要求相关接收方删除相应的信息；&nbsp;</p><p>（4） 您不再使用我们的产品或服务，或您注销了账号，或我们终止服务及运营。&nbsp;</p><p>若我们决定响应您的删除请求，我们还将根据法律法规和标准文件的规定，同时通知从我们获得您的个人信息的实体，要求其及时删除，除非法律法规另有规定，或这些实体获得您的独立授权。&nbsp;</p><p>当您从我们的服务中删除信息后，我们会立即在备份系统中删除相应的信息。&nbsp;</p><p>5. 改变、撤回授权范围&nbsp;</p><p>您可以通过小程序右上角【···】-【设置】添加或撤回已同意的权限。您可以通过点击主页下方的【查看用户协议、隐私政策及双清单】撤销隐私政策和用户协议的授权。您也可以通过本隐私政策载明的方式与我们联系，以改变同意范围或撤回您的授权，我们将在收到请求的十五个工作日内进行处理。</p><p>客服电话：18612571695</p><p>客服邮箱：691932539@qq.com</p><p>请您理解，医简历可能需要开启部分权限并收集必要的个人信息才能得以实现部分服务。当您撤回您的同意时，我们将无法继续为您提供撤回同意所对应的服务，但不会影响此前基于您的授权而开展的个人信息处理服务。&nbsp;</p><p>6. 注销账号&nbsp;</p><p>您可以通过&nbsp;【首页】-【左上角“更多”】-【账号管理】-【注销账号】&nbsp;页面自助申请注销您的账号，我们将在十五个工作日内进行处理。为了保障您的账号和数据安全，我们将会收集您所需要填写的&nbsp;手机验证码&nbsp;以便于向您再次确认注销账号的要求。如果您有任何疑问，请通过以下方式与我们联系：</p><p>客服电话：18612571695</p><p>客服邮箱：691932539@qq.com</p><p>您注销上述账号的行为是不可逆的，我们将停止为您提供产品或服务，不再收集您的个人信息，并依据您的要求删除与您账号相关的个人信息或做匿名化处理，但法律法规另有规定或监管部门另有要求的除外。</p><p>&nbsp;7. 获取个人信息副本</p><p>您可以通过本隐私政策载明的方式与我们联系，以获取您的个人信息副本，我们将在收到请求的十五个工作日内进行处理。</p><p>客服电话：18612571695</p><p>客服邮箱：691932539@qq.com</p><p>8.自动决策结果申诉</p><p>在某些业务功能中，我们可能仅依据信息系统、算法在内的非人工自动决策机制作出决定。如果这些决定显著影响您的合法权益，您有权通过本隐私政策载明的方式与我们联系，以要求我们作出解释或对信息系统自动决策结果进行投诉，我们将在收到请求的十五个工作日内进行处理。</p><p>客服电话：18612571695</p><p>客服邮箱：691932539@qq.com</p><p>9. 响应您的上述请求&nbsp;</p><p>如您无法按照上述方式行使权利的，您可以采取本隐私政策载明的联系方式与我们联系。为保障安全，您可能需要提供书面请求，或以其他方式证明您的身份。我们可能会先要求您验证自己的身份，然后再处理您的请求。我们将在收到请求的十五个工作日内进行处理。&nbsp;</p><p>对于您的合理请求，我们原则上不收取费用，但对多次重复、超出合理限度的请求，我们将酌情收取一定成本费用。对于那些无端重复、需要过多技术手段、给他人合法权益带来风险或者非常不切实际的请求，我们可能会予以拒绝。&nbsp;</p><p>如果您的请求被拒绝，我们将告知您拒绝的原因，您可以通过本隐私政策载明的联系方式进行投诉。&nbsp;</p><p>10. 响应情形的例外&nbsp;</p><p>在以下情形中，我们将无法响应您的请求:&nbsp;</p><p>（1） 与我们履行法律法规规定的义务相关的；&nbsp;</p><p>（2） 与国家安全、国防安全直接相关的；&nbsp;</p><p>（3） 与公共安全、公共卫生、重大公共利益直接相关的；&nbsp;</p><p>（4） 与刑事侦查、起诉、审判和执行判决等直接相关的；&nbsp;</p><p>（5） 我们有充分证据表明个人信息主体存在主观恶意或滥用权利的；&nbsp;</p><p>（6） 出于维护个人信息主体或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；&nbsp;</p><p>（7） 响应个人信息主体的请求将导致个人信息主体或其他个人、组织的合法权益受到严重损害的；&nbsp;</p><p>（8） 涉及商业秘密的。</p><p>&nbsp;</p><p>七、 我们如何处理未成年人的个人信息</p><p>&nbsp;</p><p>1. 我们的产品、网站和服务主要面向成年人（即18周岁以上），并无专门面向未成年人（未满18周岁，下同）的产品和服务或产品和服务的部分功能板块，无需用户输入生日、年龄信息等用以识别用户年龄。</p><p>如您为未成年人（即未满18周岁，下同），请您理解，我们非常重视对未成年人个人信息的保护，您在主动提供个人信息前，请加强个人保护意识并谨慎对待。您应在您的父母或其他监护人监督、指导下仔细阅读本隐私政策，并在征得您的父母或其他监护人同意的前提下使用我们的服务或向我们提供信息。&nbsp;</p><p>您应遵守《全国青少年网络文明公约》，为更好地保护未成年人隐私权益，请您慎重上传包含未成年人肖像的内容，增强自护意识。请您理解，我们仅为实现本隐私政策载明的目的处理您上传的内容，不作他用。</p><p>&nbsp;2. 若您是未成年人的监护人，我们提示您：</p><p>（1）请您关注您所监护的未成年人是否是在取得您的授权同意之后使用我们的产品或服务、主动向我们提供个人信息，您作为监护人应指导并监督被监护人的使用行为；</p><p>（2）请您保管好您的支付账户及支付密码等重要信息，以避免被监护人在未取得您同意的情况下在我们的产品或服务中进行支付结算；</p><p>（3）如您所监护的未成年人在未获取您同意的情况下已点击同意本隐私政策、注册医简历账户，我们提供操作路径支持您撤回授权、注销账户：</p><p>撤回授权：您可以在小程序中通过点击主页下方的【查看用户协议、隐私政策及双清单】撤销隐私政策和用户协议的授权；</p><p>注销账户：您可以在小程序中通过 点击【首页】-【左上角“更多”】-【账号管理】-【注销账号】&nbsp;自主申请注销。</p><p>若您是未成年人的监护人，当您对您所监护的未成年人是否使用我们的服务或其是否向我们提供信息有任何疑问时，请您及时按照本隐私政策载明的联系方式与我们联系。特别地，若您是儿童（即不满14周岁，下同）的监护人，为保护儿童个人信息，我们还发布了&nbsp;《医简历儿童隐私保护指引》&nbsp;。&nbsp;请您理解，我们不会主动直接向儿童收集其个人信息&nbsp;，如果我们发现自己在不知情的情况下收集了未成年人的个人信息，我们将尽快删除相关数据。</p><p>&nbsp;</p><p>八、 本隐私政策如何更新</p><p>&nbsp;</p><p>我们的隐私政策可能会适时发生变更。我们会在本页面上发布对本隐私政策所做的任何变更。对于重大变更，我们还会提供更为显著的通知（我们可能会通过在浏览页面做特别提示方式，说明隐私政策的具体变更内容）并重新获取您的同意。未经您明确同意，我们不会削减您按照本隐私政策所应享有的权利。&nbsp;对于重大变更，我们还会提供更为显著的通知（我们会通过弹窗的方式，说明隐私政策的具体变更内容）。未经您明确同意，我们不会削减您按照本隐私政策所应享有的权利。</p><p>&nbsp;本隐私政策所指的重大变更包括但不限于:&nbsp;&nbsp;&nbsp;（1）我们的服务模式发生重大变化（如处理个人信息的目的、处理的个人信息类型、个人信息的使用方式和范围等发生变化）；&nbsp;&nbsp;&nbsp;（2）个人信息共享、转让或公开披露的主要对象发生变化；&nbsp;&nbsp;&nbsp;（3）您参与个人信息处理方面的权利及其行使方式发生重大变化；&nbsp;&nbsp;&nbsp;（4）我们负责处理个人信息安全的责任部门、联络方式及投诉渠道发生变化；&nbsp;&nbsp;&nbsp;（5）个人信息安全影响评估报告表明存在高风险时。</p><p>&nbsp;</p><p>九、 如何联系我们</p><p>&nbsp;</p><p>如果您对本隐私政策或个人信息保护有任何问题、意见或建议，您可以通过【我的】-【联系客服】页面联系我们，为了就您反馈的问题进行沟通和跟进，我们将会收集您所需要填写的联系方式（邮箱地址或联系电话）。您也可以通过以下方式与我们联系：</p><p>客服电话：18612571695</p><p>客服邮箱：691932539@qq.com</p><p>&nbsp;我们收到您的问题、意见或建议，并验证您的用户身份后，我们将在十五个工作日内回复。如果您对我们的回复不满意，特别是我们的个人信息处理行为损害了您的合法权益，您还可以向网信、电信、公安及工商等监管部门进行投诉或举报。</p><p>&nbsp;</p>";
